import { load } from "@cashfreepayments/cashfree-js";

function Checkout() {
    let cashfree;
    var initializeSDK = async function () {          
        cashfree = await load({
            mode: "production"
        });
    }
    initializeSDK();

    const doPayment = async () => {
        let checkoutOptions = {
            paymentSessionId: "session_VcYcybuu442WYR92U5h2bDYHDENCPxI7RkW4Fh5ff-qTAVz7HSGIdpdXBAYg9XK3chzwbDmChfYNcosTjRH4tMctjSHkG6KkDM7ZaTIrmmP-",
            redirectTarget: "_self",
        };
        cashfree.checkout(checkoutOptions);
    };

    return (
        <div class="row">
            <p>Click below to open the checkout page in current tab</p>
            <button type="submit" class="btn btn-primary" id="renderBtn" onClick={doPayment}>
                Pay Now
            </button>
        </div>
    );
}
export default Checkout;
